import actionTypes from "../actions/actionTypes";

const initialState = {
  gender: [],
  roles: [],
  positions: []

};

const adminreducer = (state = initialState, action) => {
  switch (action.type) {
    case actionTypes.FETCH_GENDER_START:
      console.log('em minh dep trai haha: ', action)
      return {
        ...state,
      }
    case actionTypes.FETCH_GENDER_SUCCESS:
      console.log('em minh dep trai hihi: ', action)
      return {
        ...state,
      }
    case actionTypes.FETCH_GENDER_FAILED:
      console.log('em minh dep trai huhu: ', action)
      return {
        ...state,
      }
    default:
      return state;
  }
};

export default adminreducer;
